from itertools import permutations
from collections import Counter, defaultdict


class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: bool
        """
        per_list = []
        if len(set(p)) == 1:
            per_list.append(p)
        else:
            for permutation in permutations(p):
                per = ''.join(permutation)
                if per not in per_list:
                    per_list.append(per)
        position = 0
        results = []
        start = 0
        while position != -1:
            min_index = -1
            for per in per_list:
                position = s.find(per, start)
                if position != -1 and (min_index == -1 or min_index > position):
                    min_index = position

            if min_index != -1:
                results.append(min_index)
                start = min_index + 1
                position = 0

        return results

    def better(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: bool
        """
        count = length = len(p)
        counter = Counter(p)
        results = []
        for index in range(len(s)):
            if counter[s[index]] >= 1:
                count -= 1
            counter[s[index]] -= 1

            if index >= length:
                if counter[s[index - length]] >= 0:
                    count += 1
                counter[s[index - length]] += 1

            if count == 0:
                results.append(index - length + 1)
        return results

    def other(self, s, p):
        ls, lp = len(s), len(p)
        cp = Counter(p)
        cs = Counter()
        ans = []
        for i in range(ls):
            cs[s[i]] += 1
            if i >= lp:
                cs[s[i - lp]] -= 1
                if cs[s[i - lp]] == 0:
                    del cs[s[i - lp]]
            if cs == cp:
                ans.append(i - lp + 1)
        return ans


def main():
    args = [
        ["ababababab", "aab"],
        ["cbaebabacd", "abc"],
        ["abab", "ab"],
        [
            "",
            ""
        ],
        [
            "",
            "yqrbgjdwtcaxzsnifvhmou",
        ],
    ]
    solution = Solution()
    for arg in args:
        print(arg)
        # print("solution1: {}".format(solution.findAnagrams(*arg)))
        print("solution2: {}\n".format(solution.better(*arg)))
        # print("solution3: {}\n".format(solution.other(*arg)))


if __name__ == '__main__':
    main()
